sources.sass\\utils\\_variables.scss:
$main-color: #555555;
$acent-color: #ff6c00;
$secondary-color: #9da4bd;
$title-main-color: #303030;
$title-secondary-color: #ffffff;

$mobile: 480px;
$tablet: 768px;
$desktop: 1280px;

* {
  margin: 0;
  padding: 0;
}

a {
  text-decoration: none;
}

ul {
  list-style-type: none;
}

img {
  display: block;
  max-width: 100%;
  height: auto;
}

.container {
  margin-left: auto;
  margin-right: auto;
  @media screen and (min-width: $mobile) {
    width: $mobile;
    padding: 0 30px;
  }
  @media screen and (min-width: $tablet) {
    width: $tablet;
    padding: 0 40px;
  }
  @media screen and (min-width: $desktop) {
    width: $desktop;
    padding: 0 15px;
  }
}

.visually-hidden {
  position: absolute;
  width: 1px;
  height: 1px;
  margin: -1px;
  padding: 0;
  overflow: hidden;
  border: 0;
  clip: rect(0 0 0 0);
}

.flex-center {
  display: flex;
  align-items: center;
  justify-content: center;
}

.trans {
  transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);
}

@mixin font($weight, $size, $height) {
  font-weight: $weight;
  font-size: $size;
  line-height: $height;
}

sources.sass\\components\\_button.scss:
.main-button {
  width: 160px;
  height: 40px;
  box-sizing: border-box;
  border: 1px solid $acent-color;
  border-radius: 25px;
  background-color: transparent;
  cursor: pointer;
  outline: none;


  @include font(600, 12px, 1.33);
  letter-spacing: 0.09em;
  text-transform: uppercase;
  color: $title-main-color;

  &:hover,
  &:focus {
    color: $title-secondary-color;
    background-color: $acent-color;
  }

  &--dark {
    color: $title-secondary-color;
  }
}

