.header-container {
  display: flex;
  height: 580px;

  box-sizing: border-box;

  font-family: Open Sans;
  padding: 0;

  @media screen and (min-width: $mobile) {
    width: 480px;
  }
  @media screen and (min-width: $tablet) {
    width: 768px;
    height: 680px;
  }
  @media screen and (min-width: $desktop) {
    width: 100%;
  }
}

.social-wraper {
  width: 160px;

  display: flex;
  flex-direction: column;
  align-items: center;
  // justify-content: space-between;

  @media screen and(max-width: 767px) {
    position: absolute;
    margin: 0 auto;
  }

  @media screen and(min-width: $desktop) {
    width: 155px;
  }
}

.social-list {
  position: relative;
  display: flex;
  flex-direction: row-reverse;
  transform: rotate(-90deg);
  @include font(600, 11px, 1.33);
  letter-spacing: 0.2em;
  color: $title-main-color;
  margin-top: 375px;

  & a {
    color: currentColor;
  }

  &::before {
    content: '';

    position: absolute;
    top: 6px;
    left: -60px;
    height: 1px;
    width: 60px;
    background-color: $title-main-color;
  }

  @media screen and(max-width: 767px) {
    display: none;
  }
}

.social-item {
  margin-left: 40px;

  &:hover,
  &:focus {
    color: $acent-color;
  }
}

.logo {
  margin-top: 25px;

  @media screen and(max-width: 767px) {
    position: absolute;
    left: 30px;
    z-index: 1;
    top: 15px;
  }

  &-icon {
    fill: $title-secondary-color;
    width: 69px;
    height: 55px;

