  background-repeat: no-repeat;
}

.menu-button {
  position: absolute;
  display: inline-flex;
  top: 0;
  right: 0;
  z-index: 100;

  padding: 10px;
  border: none;
  outline: none;

  margin-top: 50px;
  margin-right: 30px;
  margin-left: auto;

  width: 40px;
  height: 40px;

  background-color: transparent;
  fill: #fff;

  svg {
    width: 100%;
    height: 100%;
  }

  & .icon-cross {
    display: none;
  }

  &.is-open .icon-cross {
    display: block;
    fill: $title-main-color;
