  margin-right: auto;

  @media screen and (min-width: $mobile) {
    width: 480px;
    height: 786px;
    padding: 0 30px;
  }
  @media screen and (min-width: $tablet) {
    width: 768px;
    height: 788px;
    padding: 0 40px;
  }
  @media screen and (min-width: $desktop) {
    width: 1280px;
    height: 582px;
    padding: 0 15px;
  }
}

// Box-achievement

.main-box-achievement {
  list-style: none;

  @media screen and (min-width: $desktop) {
    display: flex;
  }
}

// .price {
//   @media screen and (min-width: $desktop) {
//     display: flex;
//     justify-content: center;
//   }
// }

.box-achievement {
  position: absolute;
  padding: 20px;
  text-align: center;
  background-color: #f7f7f7;

  @media screen and (min-width: $mobile) {
    width: 193px;
    height: 133px;
  }

  @media screen and (min-width: $tablet) {
    width: 210px;
    height: 133px;
  }

  @media screen and (min-width: $desktop) {
    width: 170px;
    height: 133px;
  }

  &:nth-child(1) {
    @media screen and (min-width: $mobile) {
      top: 371px;
      left: 31px;
    }

    @media screen and (min-width: $tablet) {
      top: 357px;
      left: 279px;
    }

    @media screen and (min-width: $desktop) {
      top: 121px;
      left: 155px;
    }
  }

  &:nth-child(2) {
    @media screen and (min-width: $mobile) {
      top: 534px;
      left: 31px;
    }

    @media screen and (min-width: $tablet) {
      top: 520px;
      left: 279px;
    }

    @media screen and (min-width: $desktop) {
      top: 284px;
      left: 155px;
    }
  }

  &:nth-child(3) {
    @media screen and (min-width: $mobile) {
      top: 406px;
      left: 255px;
    }

    @media screen and (min-width: $tablet) {
      top: 392px;
      left: 519px;
    }

    @media screen and (min-width: $desktop) {
      top: 156px;
      left: 355px;
    }
  }

  &:nth-child(4) {
    @media screen and (min-width: $mobile) {
      top: 569px;
      left: 255px;
    }

    @media screen and (min-width: $tablet) {
      top: 555px;
      left: 519px;
    }

    @media screen and (min-width: $desktop) {
      top: 319px;
      left: 355px;
    }
