    flex-wrap: wrap;
  }
  @media screen and (min-width: $desktop) {
    display: flex;
    flex-wrap: nowrap;
    justify-content: space-between;
    text-align: center;
  }
}

.team-item {
  margin-bottom: 64px;

  &:last-child {
    margin-bottom: 0px;
  }

  @media screen and (min-width: $desktop) {
    padding-right: 30px;
    margin-bottom: 0px;
    &:last-child {
