    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
  }
  @media screen and(min-width: $tablet) and (max-width: $desktop - 1px) {
    margin: -15px;
  }

  @media screen and(min-width: $desktop) {
    margin: 0;
    flex-wrap: nowrap;
  }
}

.barba_item {
  @media screen and(max-width: $tablet - 1px) {
    &:not(:last-child) {
      margin-bottom: 30px;
    }
  }

  @media screen and(min-width: $tablet) {
    width: calc((100% - 4 * 15px) / 2);
    margin: 15px;
  }

  @media screen and(min-width: $desktop) {
    width: $desktop;
    margin: 0;
    margin-right: 30px;

    &:last-child {
      margin-right: 0;
    }
  }
}

.barba-icon {
  @media screen and(max-width: $tablet - 1px) {
    padding-top: 10px;
  }
  color: currentColor;
}

